import React from 'react'
import Dice from './Dice'

import club from './'
const DiceList = ({diceData}) => {
  return (
    <div className='diceList'>

                    <Dice
                        name={`${diceData.key}`}
                        image={`${diceData.key}.png`}
                    />             

        </div>
  )
}

export default DiceList
